  <template id="detail-content-zh-template"><div><span style="background-color: transparent; font-size: 15.2px; color: rgb(0, 0, 0); caret-color: rgb(0, 0, 0);">✨&nbsp;</span><span style="background-color: transparent; font-size: 15.2px; color: rgb(0, 0, 0); caret-color: rgb(0, 0, 0); font-weight: bold;">DSGN 5023&nbsp; A+项目</span></div><p class="detail-note-text"><font size="3"><span><br></span></font></p><p class="detail-note-text"><font size="3"><span>项目概要</span></font></p><p data-start="44" data-end="181" class="detail-note-text"><font size="3">Path@Penn的导航页和选课系统是学生最常使用的功能模块，但长期以来饱受诟病。常见的用户反馈包括“找不到功能入口”“不清楚选课流程”“不知道是否成功选上课程”等。在一项调查中，超过 <b>60%</b> 的学生对导航页的使用体验表示不满，而对选课流程不满意的比例更高达<b> 85%</b>。</font></p><p data-start="44" data-end="181" class="detail-note-text"><font size="3" style="background-color: transparent;">基于用户反馈与调研结果，项目组发现<b>信息展示混乱、选课操作逻辑不清晰</b>等关键痛点，并对导航页的信息架构和选课系统的交互逻辑进行了重构，通过多轮用户测试持续迭代优化设计。</font></p><p data-start="44" data-end="181" class="detail-note-text"><span style="background-color: transparent; font-size: medium;">与旧版系统相比，新方案使用户查找功能的效率提升了</span><b style="background-color: transparent; font-size: medium;"> 40%</b><span style="background-color: transparent; font-size: medium;">，选课操作的成功率提升了 </span><b style="background-color: transparent; font-size: medium;">66%</b><span style="background-color: transparent; font-size: medium;">，显著改善了整体使用体验。</span></p><h1><span>1 项目介绍</span></h1><h2><span>1.1 设计对象</span></h2><p><span><br></span></p><div class="detail-columns-block" data-columns-count="2" data-columns-color="#ffffff" style="--columns-count: 2; --columns-bg: #ffffff;"><div class="detail-columns-cell" data-column-index="1"><p></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 500px; height: 327px; overflow: visible;" data-ratio="0.6533" data-resizing="0"><font><img src="assets/1771801667666.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></font></div><font><b>导航页</b><br><p class="detail-note-text">导航页是门户网站,罗列了学校各种服务的入口, 包括选课系统、课程规划与注册、个人信息、经济资助、学习资源、支持与帮助等。</p><p></p></font></div><div class="detail-columns-cell" data-column-index="2"><p></p><div class="image-wrapper align-left" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 500px; height: 324px; overflow: visible;" data-ratio="0.6486" data-resizing="0"><font><img src="assets/1771801667681.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></font></div><font><span style="font-weight: 700;">选课系统<br></span></font><p class="detail-note-text"><font><span>选课系统是学生完成课程搜索、方案规划、正式注册、退课与重选的平台。</span></font></p><font><p></p></font></div></div><p></p><p class="detail-note-text"><br></p><h2>1.2 项目流程</h2><p class=""><font>项目按照<b>“用户研究-原型设计-用户测试”</b>的流程进行问题定义，解决方案设计和迭代，并输出最终的实施方案。</font></p><p class=""><font></font></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 800px; height: 221px; overflow: visible;" data-ratio="0.2768" data-resizing="0"><font><img src="assets/1771828429639.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></font></div><p></p><p class="detail-note-text" style="text-align: center;"><font>图1 项目流程</font></p><p style="text-align: left;">本文档将按照以上4阶段的流程，分别讲述<b>导航页</b>和<b>选课系统</b>的设计过程。</p><h1><font>2 导航页改版设计</font></h1><h2><font>2.1 用户研究</font></h2><p data-start="36" data-end="160" style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);">导航页的主要服务对象是在读学生。为此，我们对 30 余位学生开展了用户调研，并保证了<b>样本的多样性</b>——覆盖本科生与研究生、高年级学生与新生、本土学生与国际学生等不同群体。样本的多样性与相对均衡分布有助于降低调研结论的偏差，从而支持设计一个对广泛用户群体友好的产品。</p><p data-start="162" data-end="295" data-is-last-node="" data-is-only-node="" style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);">调研方法结合主客观两种路径，主要包括<b>用户访谈</b>与<b>用户测试</b>两个部分。用户访谈采用非结构化提纲，重点收集用户对现有功能与体验的评价；用户测试则通过观察用户实际使用产品的过程，并结合“为什么”的追问，深入理解用户的使用习惯、操作卡点以及用户自身未必能明确表达的问题。</p><p><font></font></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="overflow: visible; width: 800px; height: 464px;" data-ratio="0.5800" data-resizing="0"><font><img src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABlMAAAOrCAYAAADDLnCqAAAAAXNSR0IArs4c6QAAAERlWElmTU0AKgAAAAgAAYdpAAQAAAABAAAAGgAAAAAAA6ABAAMAAAABAAEAAKACAAQAAAABAAAGU6ADAAQAAAABAAADqwAAAADVdrisAABAAElEQVR4AeydB2AVxRaG//ReCCmQhCQQIPTeO1KkKUVRBKRKUQSxgc+G2EABERGQjkoVQekivffepZfQQ3pv78yGe9NuQhISSMI/7112d3Zmdubbe3fj/HPOMTL27pEIJhIgARIgARIgARIgARIgARIgARIgARIgARIgARIgARIgARIgAYMEjA3mMpMESIAESIAESIAESIAESIAESIAESIAESIAESIAESIAESIAESEAjQDGFXwQSIAESIAESIAESIAESIAESIAESIAESIAESIAESIAESIAESyIQAxZRM4PAUCZAACZAACZAACZAACZAACZAACZAACZAACZAACZAACZAACVBM4XeABEiABEiABEiABEiABEiABEiABEiABEiABEiABEiABEiABDIhQDElEzj56VQZz6JQHyYSIAESIAESIAESIAESIAESIAESIAESIAESIAESIAESIIEnS4BiypPlneOreRUrAvVhIgESIAESIAESIAESIAESIAESIAESIAESIAESIAESIAESeLIEKKY8Wd68GgmQAAmQAAmQAAmQAAmQAAmQAAmQAAmQAAmQAAmQAAmQQAEjQDGlgN0wdpcESIAESIAESIAESIAESIAESIAESIAESIAEMiNgZJTZ2aRzWSnz6FZYggRIgASeHQKmz85QOVISIAESIAESIAESIAESIAESIAESIAESIAESKPwEEhOBxl5F0LmyO6p4OqKSu4M26JM3g3H8RhD+OnETO64FFn4QBWiExoiHBUJglhAC04QwICEcJgkRMoI4JCQkwMTUDIkmdjA2tUOisT2iYI2IBFvEJZoUoFGyqyRQsAkYGXv3kMcrU34n0KJWaa2Lmw5eyHFXj678AufOXMxx/ZxULONXEg26foOo2PicVH8qdT7s1wo+3m5wdy2CYm7yke2GrUcw8NPfnkp/eFESIAESIAESIAESIAESIAESIAESIAESyCoBGzNjTHqxMno3KAXjDMxPEkRt+W3PJQxfcQKhsQlZbZrl8oCANUJhFn8P5nigCSnq3iSqDxIQHx8PY2NjGMn/4uLjYGJiKscmsLS0hI21pQgptoiIc0B4ggMCY63yoHdskgRIICUBWqakpFHI9w9u3YOg8V8+0VEGDf8EyODF/UQ7ko2LxcbFw05eSE0aVIKjg41W097OOhstsCgJkAAJkAAJkAAJkAAJkAAJkAAJkAAJPHkCVqbG2PRWY9T2LprpxZXI0qeBLyp6FEHzKdsRGUdBJVNgeXCyWmln3Ll2BMZRN0QoURYoiTAyNYGxLHtPkDXJsbFxkif+2uTWGEu+mdpNlBNy3kQEFnXeGEGwNw+HvVEAPJy84VisAnYeu5YHvWWTJEACigDFlGfse2CdEIOoUuXh3KgxrGxF+74XADt3d t>进入动机：用户打开导航页的动机是什么？用户在什么场景下会打开导航页？</font></li></ul><ul><li><font>功能使用：</font><span>用户主要使用导航页的哪些功能？各项功能的使用频率如何？</span></li></ul><ul><li><font>主观评价：</font><span>用户对现有导航页的喜好与不满点分别是什么？其背后的原因是什么？</span></li></ul><p class="detail-note-text"></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 320px; height: 441px; overflow: visible;" data-ratio="1.3794" data-resizing="0"><img src="assets/1771913167885.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></div><p style="text-align: center;" class="detail-note-text"><span>图3 我所负责部分的调研结果整理</span></p><p></p><p></p><p></p><p></p><p></p><p><font>我们的调研得出了以下发现：</font></p><p></p><p></p><ol><li><span style="background-color: transparent; font-size: 0.95rem;">导航页没有起到“导航”的作用，主要</span><b style="background-color: transparent; font-size: 0.95rem;">充当高频应用的入口</b><span style="background-color: transparent; font-size: 0.95rem;">。90%+用户只知道并使用导航页的3-5个入口。大多数人把导航页作为高频应用的入口，自动忽视其他应用。当他们尝试寻找学校服务的入口的时候，他们更倾向于使用搜索引擎而非导航页。</span></li><li><span style="background-color: transparent; font-size: 0.95rem;">高频应用入口难以快速定位</span><span style="background-color: transparent; font-size: 0.95rem;">。导航页在一个页面提供了50个入口，文字多且无明显区分。</span></li><li><span style="background-color: transparent; font-size: 0.95rem;">界面信息负担过重。</span><span style="background-color: transparent; font-size: 0.95rem;">80%+用户对导航页的界面设计感到不满，集中在</span><span style="background-color: transparent; font-size: 0.95rem;">信息量过多，主次要素区分不明显，板块分类条件不明，背景杂乱</span><span style="background-color: transparent; font-size: 0.95rem;">。</span></li></ol><p></p><p></p><h2><font>2.2 原型设计与测试迭代</font></h2><h3>改进方向（How might we）</h3><p><font>根据用户调研的结论，我们确定了改进的方向：</font></p><p></p><p></p><ol><li><font style="background-color: transparent; font-size: 0.95rem;"><b>“我们如何帮助用户更高效的进入高频应用？”</b>：</font><span style="background-color: transparent; font-size: 0.95rem;">超过 <b>90% </b>的使用场景是从导航页进入高频应用。</span></li><li><span style="background-color: transparent; font-size: 0.95rem;"><b>“我们如何让信息层级的呈现更加清晰？”</b>：<b>80%+</b>用户认为导航页信息组织混乱</span></li><li><span style="background-color: transparent; font-size: 0.95rem;"><b>“我们如何帮助用户快速找到所需的服务？”</b>：<b>99%</b>用户不知道导航页有搜索功能且导航页可提供服务不止页面罗列的入口</span></li></ol><p></p><p></p><p><span style="font-weight: 400;">我们采用“</span><b>自下而上</b><span style="font-weight: 400;">”的设计过程：先头脑风暴提出大量idea，再淘汰和整合，形成一个功能，输出4-5个功能后，再将它们整合起来，形成几套解决方案，每套解决方案对应不同的侧重点，再基于用户反馈决定迭代方向。</span></p><p></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="true" style="overflow: hidden; width: 600px; height: 494px;" data-ratio="0.8233" data-resizing="0"><img src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAACHQAAAd6CAYAAAAR9KicAAAAAXNSR0IArs4c6QAAAERlWElmTU0AKgAAAAgAAYdpAAQAAAABAAAAGgAAAAAAA6ABAAMAAAABAAEAAKACAAQAAAABAAAIdKADAAQAAAABAAAHegAAAADtbvBrAABAAElEQVR4AezdBbgc1dkA4IMlobhLcYfSoi2FUhwKxd2Du7sEl2DFCQ7BCRIcinuBAsVLS1ugSAMUKBSXAv98y7+XvXtn9u4md5NJ8p4+y+6esbPvTHpHvvOdMb7LSlIIECBAgAABAgQIECBAgAABAgQIECBAgAABAgQIECBAgAABAgRKIzBmaVqiIQQIECBAgAABAgQIECBAgAABAgQIECBAgAABAgQIECBAgAABAhUBAR0OBAIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIBAyQQEdJRsh2gOAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQEBAh2OAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIFAyAQEdJdshmkOAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQENDhGCBAgAABAgQIECBAgAABAgQIECBAgAABAgQIECBAgAABAgQIlExAQEfJdojmECBAgAABAgQIECBAgAABAgQIECBAgAABAgQIECBAgAABAgQEdDgGCBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIlExDQUbIdojkECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQEdjgECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAQMkEBHSUbIdoDgECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIEBAQIdjgAABAgQIECBAgAABAgQIECBAgAABAgQIECBAgAABAgQIECBQMgEBHSXbIZpDgAABAgQIECBAgAABAgQIECBAgAABAgQIECBAgAABAgQIEBDQ4RggQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECJRMQEBHyXaI5hAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIEBHQ4BggQIECAAAECBAgQIECAAAECBAgQIE qAQMcom3afBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAQDcCAh3drMpBCRAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAgVEEBDpG2bT7JECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBLoREOjoZlUOSoAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECIwiINAxyqbdJwECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQINCNgEBHN6tyUAIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQGAUAYGOUTbtPgkQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAAIFuBAQ6ulmVgxIgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQKjCAh0jLJp90mAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAh0IyDQ0c2qHJQAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAYRUCgY5RNu08CBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECgGwGBjm5W5aAECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIDAKAICHaNs2n0SIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAEC3QgIdHSzKgclQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIERhEQ6Bhl0+6TAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQ6EZAoKObVTkoAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgMIqAQMcom3afBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAQDcCAh3drMpBCRAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAgVEEBDpG2bT7JECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBLoREOjoZlUOSoAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECIwiINAxyqbdJwECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQINCNgEBHN6tyUAIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQGAUAYGOUTbtPgkQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAAIFuBAQ6ulmVgxIgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQKjCAh0jLJp90mAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAh0IyDQ0c2qHJQAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAYRUCgY5RNu08CBAgQIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECgGwGBjm5W5aAECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIDAKAICHaNs2n0SIECAAAECBAgQIECAAAECBAgQIECAAAECBAgQIECAAAEC3QgIdHSzKgclQIAAAQIECBAgQIAAAQIECBAgQIAAAQIECBAgQIAAAQIERhH4P0kt79XLWFU4AAAAAElFTkSuQmCC" alt="" draggable="false" style="object-fit: contain; width: 600px; height: 531px; position: absolute; left: 0px; top: -37px; max-width: none;"></div><p></p><p></p><p></p><p style="text-align: center;" class="detail-note-text">图4 方案设计过程</p><h3>功能设计</h3><p><font><span style="font-size: 15.2px;"><b>针对高频应用：收藏夹</b></span></font></p><p><font><span style="font-size: 15.2px;"><br></span></font></p><p><span style="font-size: 15.2px;"><b>针对低频应用：折叠栏</b></span></p><p><br></p><p><b>强化搜索功能：搜索框</b></p><p><br></p><p><b>新增推荐功能：推荐栏</b></p><p class=""><font></font></p><p><font><br></font></p><p><font><br></font></p><h3><font>界面布局设计</font></h3><p><font>在完成功能的设计后，我们将功能整合，形成我们的解决方案。根据侧重点的不同，我们提出了三个方向的<b>解决方案</b>用于用户测试：</font></p><div class="detail-columns-block" data-columns-count="3" data-columns-color="#f5f5f7" style="--columns-count: 3; --columns-bg: #f5f5f7;"><div class="detail-columns-cell" data-column-index="1"><p></p><div class="image-wrapper align-left" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 320px; height: 209px; overflow: visible;" data-ratio="0.6530" data-resizing="0"><font><img src="assets/1771913167894.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></font></div><font><b>方向1—全能模式：搜索+个性化+推荐+低频折叠</b><p></p></font></div><div class="detail-columns-cell" data-column-index="2"><p></p><div class="image-wrapper align-left" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 320px; height: 209px; overflow: visible;" data-ratio="0.6535" data-resizing="0"><font><img src="assets/1771913167897.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></font></div><font><b>方向2—极简模式：突出搜索+个性化，弱化其他</b><p></p></font></div><div class="detail-columns-cell" data-column-index="3"><p></p><div class="image-wrapper align-left" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 320px; height: 208px; overflow: visible;" data-ratio="0.6486" data-resizing="0"><font><img src="assets/1771913167900.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></font></div><font><b>方向3—搜索框上移，突出应用入口</b><p></p></font></div></div><p><font><br></font></p><p><font><br></font></p><h3><font>用户反馈</font></h3><p><font><br></font></p><p><font><br></font></p><p><font><br></font></p><p><font></font></p><hr id="null"><p><font>当然，也有用户提出了<b>反面</b>的建议：</font></p><p>一位用户称尽管新的界面看上去更加清晰了，但他已经<b>习惯</b>了现在这个页面，更新页面也未必提高效率。<br></p><blockquote><span>高年级学生往往已经对原有系统形成固定使用路径，并发展出自己的“捷径”与应对策略</span><span>。但学校学生群体流动性高（本科4年，硕士1-2年），改版从长远而言还是很有效益的。</span></blockquote><p>另一位用户则质疑个性化定制和推荐的必要性：“或许没有人会花时间去定制这个界面，他们只需要知道应用的入口在哪里”；“推荐应用的功能看上去很酷，但是我急着要去选课的时候，真的会点进去看吗？”</p><p></p><blockquote><span data-start="402" data-end="426">新生对导航页表现出强大的好奇心与探索行为</span><span>，会主动点击不同应用以理解其功能。新用户对花时间进行定制并不抵触。个性化配置还能在早期阶段逐步建立使用习惯，大多数中高年级同学也表示愿意尝试。推荐机制则可以推送学校优质的应用和服务，为学生创造更好的就读体验。</span></blockquote><p><font>因此我们最终选择了<b>方向1</b>作为深化方向，并坚持了大多数用户认可的<b>搜索+个性化+推荐</b>的核心功能。</font></p><p class="detail-note-text"><font></font></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 600px; height: 392px; overflow: visible;" data-ratio="0.6530" data-resizing="0"><font><img src="assets/1771913167904.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></font></div><font><p style="text-align: center;" class="detail-note-text">图4 被选中的方向1的低保真原型</p></font><p></p><h2><font>2.3 实施方案</font></h2><p><font><br></font></p><h2><font>2.4 效果评估</font></h2><p><font><br></font></p><h1><font>3 选课系统改版设计</font></h1><h2>3.1 用户研究</h2><p style="font-size: 15.2px;"><br></p><h2>3.2 原型设计与测试迭代</h2><p style="font-size: 15.2px;"><br></p><h2>3.3 实施方案</h2><p style="font-size: 15.2px;"><br></p><p></p><h2>3.4 效果评估</h2><p><br></p><p><font><br></font></p><p><font><br></font></p></template>
